<p>unreduced</p>
<h2>Usage</h2>
<p>builtin-function</p>
<h2>Syntax</h2>
<p><code class=syntax>
(<b>unreduced</b> <i>obj</i>)</code><br/></p>
<h2>Description</h2>
<p>Returns the value wrapped in <code>obj</code> or else <code>obj</code> itself.</p>
